import 'bootstrap/dist/css/bootstrap.min.css';

interface ModalProps{
    children: React.ReactNode
    title: number
}

export function Modal({ children, title}: ModalProps) {
    return (
        <div className='Modal'>
            {title}
            {children}
        </div>
    )
}
